DROP TABLE general_task;
DROP TABLE pto_request;
DROP TABLE assigned_training;
DROP TABLE performance_review;
DROP TABLE employees;

CREATE TABLE employees(
	"firstName"		text,
	"lastName"		text,
	"employeeId"	bigserial,
	"email"			text UNIQUE,
	"companyId"		bigserial,
	"companyName"	text,
	"managerId"		bigint DEFAULT 0, 
	"positionTitle"	text,
	"startDate"		date,
	"isManager"		boolean,
	"password"		text,
	PRIMARY KEY("employeeId", "companyId")
);

CREATE TABLE pto_request(
	"employeeId"	bigserial,
	"companyId"		bigserial,
	"pto_id"		bigserial PRIMARY KEY,
	"title"			text,
	"description"	text,
	"start_date"	date,
	"end_date"		date,
	"date_created"	date DEFAULT CURRENT_DATE,
	"date_due"		date,
	"progress"		text,
	"approved"		boolean,
	"assigned_to"	bigint,
	FOREIGN KEY("employeeId", "companyId") REFERENCES employees("employeeId", "companyId")
);

CREATE TABLE performance_review(
	"employeeId"		bigserial,
	"companyId"			bigserial,
	"pr_id"				bigserial PRIMARY KEY,
	"title"				text,
	"overall_comments"	text,
	"growth_feedback"	int,
	"kindness_feedback"	int,
	"delivery_feedback"	int,
	"date_created"		date DEFAULT CURRENT_DATE,
	"progress"			text,
	"assigned_to"		bigint,
	FOREIGN KEY("employeeId", "companyId") REFERENCES employees("employeeId", "companyId")
);

CREATE TABLE assigned_training(
	"employeeId"	bigserial,
	"companyId"		bigserial,
	"at_id"			bigserial PRIMARY KEY,
	"title"			text,
	"description"	text,
	"link"			text,
	"date_created"	date DEFAULT CURRENT_DATE,
	"date_due"		date,
	"progress"		text,
	FOREIGN KEY("employeeId", "companyId") REFERENCES employees("employeeId", "companyId")
);

CREATE TABLE general_task(
	"employeeId"	bigserial,
	"companyId"		bigserial,
	"task_id"		bigserial PRIMARY KEY,
	"title"			text,
	"description"	text,
	"date_created"	date DEFAULT CURRENT_DATE,
	"date_due"		date,
	"progress"		text,
	"assigned_to"	bigint,
	FOREIGN KEY("employeeId", "companyId") REFERENCES employees("employeeId", "companyId")
);


